import React, { Component } from "react";
import Timer from "./Timer";

const WorkoutPage = (props) => {
    const {selectedWorkouts} = props;
    return(
        <div className="container-fluid">
            <div className="row">
                <Timer />
            </div>
            <div className="row justify-content-center">
                <div className="col-md-4">
                    <h1>
                        Reps | Selection <i className="fa fa-plus"></i>
                    </h1>
                    <ul className="eList">
                        {selectedWorkouts.map((exercise) => {
                        return (
                            <li key={uuid()}>
                            <span className="repsLi">{exercise.reps}</span>
                            <span
                                onClick={() => workoutCompleted(exercise)}
                                className="compLi"
                            >
                                <i className="fa fa-check"></i>
                            </span>
                            {exercise.title}
                            <span
                                onClick={() => workoutDeselect(exercise)}
                                className="float-right trash"
                            >
                                <i className="fa fa-trash"></i>
                            </span>
                            </li>
                        );
                        })}
                    </ul>
                </div>
            </div>

        </div>
    )
}

export default WorkoutPage;
